&quot;College sandwich&quot;
College in: Pennsylvania
Added: December 04, 2009

Pre gaming before partying is usually just a cheap way to prepare for a long night ahead, but these kids at Penn State take it to the next level. At first the boys and girls at State hang out in the dorms, throwing back drinks and slowly getting looser as the time goes by. Meeting and greeting and whatnot. Then a Russian exchange student named Yan gets introduced to the American way of partying, and he shows the locals a thing or two on how things get done overseas. By this time all kinds of debauchery has broken loose.Im talking girls stripping down and sucking the living daylights out of dudes. Some quiet girl next door to all the action is trying to study, but what do you know...she ends up getting pulled into it! Its a total fuckfest. What was supposed to be a slow way to begin a night ended up being wilder than anything that wouldve happened out on the town. This tape is a classic college experience that you dont want to miss out on.

